import React from 'react';
import { useState } from 'react';
import Bt1 from './Bt1';
import Bt2 from './Bt2';
import Bt3 from './Bt3';
import './Roboto-Black.ttf'


function App() {
  const[posi,setposi] = useState(1);
  function bt1(){setposi(1)}
  function bt2(){setposi(2)}
  function bt3(){setposi(3)}


  return (<>

  <div className="header">
        <div className="logo">
            Header Logo
        </div>

        <div className="link">
        <button onClick={bt1} className = 'button'>bt1</button>
        <button onClick={bt2} className = 'button'>bt2</button>
        <button onClick={bt3} className = 'button'>bt3</button>

        </div>
  </div>

  {(posi==1)&&<Bt1 />}
  {(posi==2)&&<Bt2 />}
  {(posi==3)&&<Bt3 />}</>);
}

export default App;
